import React from "react";
import axios from "axios";
import { Link } from "react-router-dom";

export default class SearchResults extends React.Component {
  constructor(props) {
    super(props);
  }

  displayResult = () => {
    const movie = this.props.movie;
    return (
      <Link
        to={{
          pathname: "/movie/details",
          movieID: movie.imdbID,
          server: this.props.server,
        }}
      >
        <div className="card h-auto w-75 " id="post-box">
          <div className="card-body mb-1 pb-0 border-bottom" id="post-cont">
            <div className="container h-auto pb-0 mx-0 px-0">
              <div className="d-flex flex-row">
                <h5 className="card-title h-auto">
                  {movie.Title} ({movie.Year})
                </h5>
              </div>
            </div>

            <div>
              <p id="date" className="text-sm-left mb-1">
                Type: {movie.Type}
              </p>
            </div>
            <div className="media" id="post-box">
              <img
                src={movie.Poster}
                height="180"
                width="140"
                className="mr-3 mb-2"
                alt={movie.Title}
              />
            </div>
          </div>
        </div>
      </Link>
    );
  };

  render() {
    return <this.displayResult />;
  }
}
